/** @format */

import React from "react";
import styles from "./Main.module.css";

function Main() {
  return (
    <div>
      <div className="{styles.slick_list}">
        <div className="{styles.slick_slide}"></div>
        <div className="{styles.slick_slide}"></div>
        <div className="{styles.slick_slide}"></div>
        <div className="{styles.slick_slide}"></div>
        <div className="{styles.slick_slide}"></div>
        <div className="{styles.slick_slide}"></div>
      </div>
      <div></div>
    </div>
  );
}

export default Main;
